(1, 32, 'Snorkeling House in Cahuita, Costa Rica', 'snorkeling-house', '', '<h3><img style="margin-right: 10px; float: left;" alt="Fernando Snorkeling House Cahuita Costa Rica" src="images/fernando-snorkeling-house-thumb.jpg" height="188" width="300" />The Snorkeling House Eco-Friendly</h3>\r\n<p>The Snorkeling House specialises in tours with a distinctly eco-conscious approach. The owner, Fernando Davis Brown, believes that educating people about the fragile balance of the local eco systems can do more to create awareness and consciousness about the natural environment that we all live in. This approach is designed to help people to begin to think more about how everything is interconnected and we all can play a part in preserving Mother Earth’s natural resources.</p>\r\n<p>Fernando Davis Brown was raised in Cahuita, Costa Rica, and has been enjoying the ocean since the age of nine. Whether it was fishing, snorkelling or surfing, his connection with the sea has always been strong. You will enjoy conversing and laughing with Fernando as his easy-going nature and extensive knowledge of the sea makes his tours fun, informative and memorable. More than 500 species of fish inhabit the waters along this stretch of coast.</p>\r\n<p>Besides running Snorkeling House, Fernando also designs gardens, showing off the natural splendour of tropical vegetation at its very best. Fernando spends his time with the local Bri Bri Indians teaching, as well as learning about the medicinal value of plants, surfing and helping with Miss Edith’s, the family restaurant, from where he launches his tours.</p>\r\n<h3>Eco tourism in Cahuita, Costa Rica<img style="margin-left: 10px; float: right;" alt="Snorkeling House Cahuita Reef Costa Rica" src="images/snorkeling-house-cahuita-thumb.jpg" height="188" width="300" /></h3>\r\n<p>Eco tourism is a valuable source of income to the communities living in Cahuita and surrounding area. Making visitors aware of the problems as well as the advantages that can be derived from tourism is one of the aims local proprietors like Fernando have set themselves.</p>\r\n<p>Cahuita is a relaxed seaside town in Costa Rica with excellent beaches and stunning coastline. The Cahuita National Park is just on the doorstep and Fernando is delighted he can show visitors some of his country’s finest flora and fauna during his adventure tours into the park. North of Cahuita’s town centre is a gorgeous black-sand beach, reminiscent of Costa Rica’s volcanic origins.</p>\r\n<p>To the south of the town lies the Cahuita National Park. As Fernando’s tours take visitors inland, he is happy to tell participants in his adventure tours more about the coatis, snakes, inquisitive white-faced monkeys, colourful butterflies and hermit crabs that share this beautiful part of Costa Rica with Fernando and his community.</p>', '', 1, 0, 0, 2, '2011-07-26 17:49:32', 42, '', '2011-07-29 05:02:45', 42, 0, '0000-00-00 00:00:00', '2011-07-26 17:49:32', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 4, '', '', 1, 45414, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 33, 'Cahuita National Park Guide', 'cahuita-national-park-guide', '', '<h3>The Cahuita National Park</h3>\r\n<p>The Cahuita National Park was created on September 7, 1970, for the purpose of protecting the coastal flora and fauna of the region, in addition to Cahuita’s coral reefs and marine eco systems. Cahuita’s main attractions are its white sandy beaches, miles of coconut groves, tranquil clear seas and the beautiful coral reef. Cahuita Point is mostly swamp, with an abundance of coconut and beach almond trees.</p>\r\n<p>The reef sits off Cahuita Point and fans out over an area of 240 hectares. It is the only mature coral formation found along Costa Rica’s Caribbean coastline. Among the coral species are the Elkhorn and smooth brain, with Venus sea fans, sea urchins and numerous species of fish like the French angel fish, blue parrot fish, barracuda and queen angel fish also inhabiting the waters. Other species present are the sea cucumber, lobster, white shrimp, green turtle and various crustaceans like hermit crabs. The four identified species of crabs are also very abundant. Iguanas lazing in the sun can also swim when necessary and they can often be seen scrambling over roots and fallen tree-trunks in the swampy parts of Cahuita Point.</p>\r\n<h3>Cahuita and the Puerto Vargas Ranger Station</h3>\r\n<p>The four mile trail which connects Cahuita and the Puerto Vargas Ranger Station is well marked and maintained. White-faced monkeys, sloths and large webbed spiders are very common in this park, offering visitors much scope for a photo safari. Along the path, numerous possibilities exist to swim and or snorkel to explore the marine life in Cahuita National Park. If you need to rent snorkel equipment, Cahuita town offers the greatest number of possibilities.</p>\r\n<p>Inland the birds and mammals inhabiting the forests are among Costa Rica’s most beloved creatures. The talkative howler monkeys, cheeky raccoons and cute white-nosed coatis are ever present, as are several species of swamp-forest birds, such as the green ibis, the yellow-crowned night heron and the Northern boat-billed heron. The coati is one of South America’s most ancient, aboriginal species. The slow and placid three-toed sloths are often camouflaged by microscopic algae, turning the sloth’s coat and skin an eerie grey-green to hide them in their leafy surroundings.</p>', '', 1, 0, 0, 2, '2011-07-26 18:14:22', 42, '', '2013-06-22 16:43:18', 43, 0, '0000-00-00 00:00:00', '2011-07-26 18:14:22', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 5482, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 34, 'Costa Rica Guide', 'costa-rica-guide', '', '<h3>Costa Rica in Central America</h3>\r\n<p>Costa Rica is located in Central America, bordering both the Caribbean Sea and the North Pacific Ocean, between Panama and Nicaragua. Costa Rica’s climate is both topical and subtropical. Costa Rica’s dry season is from December to April; the rainy season is from May to November.</p>\r\n<p>Costa Rica’s waterfalls, rain and cloud forests are famous for their beauty. Rare species of birds like the Quetzel, deemed to be the planet’s most colourful, beautiful bird or the many species of amphibian, with adorable golden tree frogs or tiny hummingbirds, flitting from tropical flower to flower to sip nectar can be found in the rain forests in Costa Rica.</p>\r\n<p>Costa Rican terrain consists of coastal plains separated by rugged mountains including over 100 volcanic cones, of which several are major volcanoes. Four volcanoes, two of them active, rise near the capital of San José in the centre of the country.</p>\r\n<h3>Costa Rica Depends on Tourism</h3>\r\n<p>Costa Rica’s basically stable economy depends on tourism, agriculture and electronic exports. Poverty has been substantially reduced over the past 15 years, and a strong social safety net has been put into place. Foreign investors remain attracted by the country’s political stability and high educational levels, and tourism continues to bring in foreign exchange.</p>\r\n<p>In recent years the importance of protecting the natural beauty of the country’s flora and fauna has been recognised and eco-tourism is now widely acknowledged as being the country’s best option to preserve its natural resources and bring in much needed revenue to remote communities in forests and mountain ranges across the country.</p>\r\n<h3>Costa Rica World’s Finest National Parks</h3>\r\n<p>Costa Rica has some of the world’s finest national parks with Arenal Volcano and Monteverde Cloud Forest Reserves being among the most famous ones. Marine life is also protected in marine reserves like the Cahuita National Park, where Costa Rica’s largest coral reef can be found, and the Parque Nacional Tortuguero, an important nesting site for green and leatherback turtles.</p>\r\n<p>Costa Rica’s music and folklore festivals attract many tourists to the old colonial cities and during December and January many fiestas are being held in honour of local saints and heroes. With the arrival of Fair Trade initiatives and coffee, dairy and sugar cane co-operatives the agricultural industries have been uplifted from the exploitative practices of former years. Many coffee and sugar cane mills offer guided tours to tourists, providing a real insight into the lives of a people used to dealing with a challenging climate and environment without losing their natural zest for life.</p>', '', 1, 0, 0, 2, '2011-07-26 18:22:18', 42, '', '2011-07-26 18:24:20', 42, 0, '0000-00-00 00:00:00', '2011-07-26 18:22:18', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 2, '', '', 1, 4075, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(4, 35, 'Cahuita National Park Snorkeling Tour', 'cahuita-national-park-snorkeling-tour', '', '<h3><img style="margin-right: 10px; float: left;" alt="cahuita-snorkeling-tour-thumb" src="images/cahuita-snorkeling-tour-thumb.jpg" height="188" width="300" />Snorkeling in Cahuita National Park Reef</h3>\r\n<p>The Cahuita National Park in Costa Rica covers 1068 ha of forest inland but offshore it protects a marine area of 22,400ha, including a beautiful coral reef.</p>\r\n<p>So why not take a boat with your tour guide Fernando and learn more about the Cahuita National Park Reef? The coral reef offers a home to 35 species of coral, including Elkhorn, fan and brain coral, fire and leather coral. There are also other types of marine life, such as sea urchins, moray eels, sea turtles, lobsters and sharks. In total, this incredibly important reef is inhabited by 128 species of algae, 44 species of crustaceans, 140 species of molluscs and 123 species of fish including: squirrel fish, jewel fish, box fish, French angel fish, queen angel fish, frog fish, butterfly fish, sting rays and snappers.</p>\r\n<p>The Snorkeling House Cahuita tour starts off with a boat ride to the snorkel area where you can enjoy hours of snorkelling around the beautiful reef. For your safety Cahuita National Park has installed a snorkelling trail that consists of a 400 meter line with white buoys marking the safe areas. There is a drop off where you can do some free diving to explore the colourful underwater world. With some luck, you may even see a green turtle!</p>\r\n<h3><img style="margin-left: 10px; float: right;" alt="cahuita-coral-reef-thumb" src="images/cahuita-coral-reef-thumb.jpg" height="188" width="300" />A Tasty Snack of Fresh Fruit after the Snorkeling</h3>\r\n<p>Thanks to Snorkeling House having a family connection with legendary Miss Edith’s Restaurant, a tasty snack of fresh fruit and beverages can be provided for lunch. Once re-energized, visitors have the choice to return by boat or hike 3.5 km (1 hr 45m) through the Cahuita National Park back to Cahuita town centre.</p>\r\n<p>This offers a wonderful opportunity to spot some of the wildlife inland and along the coastal path. Make sure you have your camera ready for parrots, toucans, herons, ibis and a wide variety of other birds are just waiting to show off their beautiful plumes. The white-faced monkeys are very sociable and may come right up to you expecting to be fed. But be warned – it is prohibited to feed them and so don’t be tempted to share your lunch with them.</p>\r\n<p>Other animals like the iguanas, agoutis, sloths and anteaters require a keen eye and a little patience, but once spotted they provide a wonderful photo opportunity for showing friends and family at home, what an adventure you’ve had.</p>\r\n<p><img style="margin-left: 10px; float: right;" alt="snorkeling-cahuita-coral-reef-thumb" src="images/snorkeling-cahuita-coral-reef-thumb.jpg" height="188" width="300" />Tour price per person: Adults pay $25 per person, kids under 8 years old pay $15 per child</p>\r\n<p>A typical snorkelling package includes: your local guide, fruit refreshments, a guided walk and a delicious Caribbean lunch at Miss Edith’s Restaurant: the tour price per person is $35.00.</p>\r\n<p>Departures: Snorkeling House Cahuita tours depart from behind Miss Edith’s Restaurant.</p>\r\n<p>Location: from the bus station visitors should follow the main road north and turn right at the police station, following this road they will find Miss Edith’s Restaurant is located on the right hand side.</p>\r\n<p>The meals for the regular tours without the lunch at Miss Edith’s consist of an individual fruit box with a drink, which is provided for each person taking part in the tours.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>What to bring:</strong><img style="margin-left: 10px; float: right;" alt="cahuita-national-park-thumb" src="images/cahuita-national-park-thumb.jpg" height="188" width="300" /><br /> Sun block :<i>&nbsp;applied 30 minutes prior to entering water</i><br /> Camera<br /> Towel<br /> Hiking shoes<br /> Insect repellent</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Snorkeling House Cahuita provide the equipment and a knowledgeable guide who will help you get the most out of your dive. Snorkel gear and life jackets are also provided.</p>\r\n<p>Safety information:<br /> Boats are equipped with two way radios and first aid kits</p>\r\n<p>The entire tour is guided, and it is very important to follow your guide, avoiding touching or stepping on the coral.</p>\r\n<p>Your tour guide Fernando is trained in the following:<br /> CPR<br /> Life Guard</p>\r\n<p>Coast Navigation<br /> First Aid</p>', '', 1, 0, 0, 2, '2011-07-26 18:31:21', 42, '', '2013-06-22 16:42:30', 43, 0, '0000-00-00 00:00:00', '2011-07-26 18:31:21', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 1, '', '', 1, 7784, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 36, 'Snorkeling House Cahuita Adventure Tours', 'cahuita-adventure-tours', '', '<p>Take a 2 hour tour through the primary virgin, uncut mountains of Cahuita, where you will see toucans, colourful parrots, three-toed sloths, anteaters, howler and white-faced monkeys, snakes, lizards, insects, frogs and much, much more!<br /><br />There are several tours to choose from:</p>\r\n<ul>\r\n<li>The Indian Reservation Tour: learn more about Costa Rica’s indigenous people by visiting a reservation with a guide. The tour costs $50.00 per person;</li>\r\n<li>The Cahuita Park Tour: visit the Cahuita National Park with an experienced guide; this tour costs $40.00 per person;</li>\r\n<li>The Fishing Tour: why not join a fishing trip with your Snorkeling House guide? This trip costs $70 per person and runs from 6am to noon;</li>\r\n<li>The Dolphin Watching Tour: get up early and listen to the dolphins chatting to one another and watch them play. The tour costs $60 per person and lasts from 6am to 8:30 am. Enjoy the dolphin show from the boat!</li>\r\n</ul>\r\n<p><br /><br /><br />Light weight clothing is recommended for these tours.<br /><br />Snorkeling House Cahuita in Costa Rica prides itself on offering eco-friendly, responsible tours to visitors. Your guide Fernando is very knowledgeable about the flora and fauna of the area and will be happy to tell you tales of tree-dwelling tamandua, cute coatis and sleepy sloths hanging in the trees above you. His knowledge of the local culture and heritage as well as his connection with the Bri Bri indigenous people of Costa Rica will enrich your stay in Cahuita and will give you a real insight into this fascinating country.<br /><br />Costa Rica is particularly loved by bird watchers the world over and you should be able to spot toucans, macaws, parrots, hummingbirds and waterfowl like herons and ibis. The length of the beach part of Cahuita National Park’s 1068 ha can be walked in about 3 hours. Take plenty of drinking water with you, as the climate is hot and humid in this part of Costa Rica. <br /><br />A Snorkeling House tour with Fernando will give you a first impression of the amazing land and marine animals and plants of Cahuita’s coast.</p>', '', 1, 0, 0, 2, '2011-07-26 18:36:27', 42, '', '2013-06-22 16:33:45', 43, 0, '0000-00-00 00:00:00', '2011-07-26 18:36:27', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 0, '', '', 1, 4884, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
